import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

export default function GameInfoPage(props) {
  console.log('game info', props);
  const developer = null;
  return (
    <Container className="pt-5">
      <Row>
        <Col lg={2} className="about-game">
          About Game
        </Col>
        <Col lg={10}>
          <Row className="pb-3">
            <Col>
              <h5>Developer</h5>
  <p>{}</p>
            </Col>
            <Col>Publisher</Col>
            <Col>Available</Col>
          </Row>
          <Row>
            <Col>Tags</Col>
            <Col>Rating</Col>
            <Col>Platform</Col>
          </Row>
        </Col>
      </Row>
    </Container>
  );
}
